import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './home';
import One from './One';
import Two from './Two';
import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/one" element={<One />} />
      </Routes>
    </div>
  );
}

export default App;
